import React, { Component } from 'react'
import PropTypes from 'prop-types'

class Graph extends Component {
    render() {
        const stock = this.props.stock;

        return (
            <tr>
            {stock.graph.map((data) => (

                <td> {data[0]} </td>

            ) )

             }
            </tr>


        )

    }
}

//Graph.PropTypes = {
